import React from 'react';
import { TextField,Grid, Button } from '@material-ui/core';

export default class HobyList extends React.Component{
    state = { arrList: [] };
    addToList = (hobby: string) => {
        this.setState({
            arrList: [...this.state.arrList, hobby]
        });
    }
    render() {
        return (
            <div>
                <Grid container justify="center">
                    <form>
                        <TextField id="standard-basic" label="Type your hobbies" />
                        <Button type="submit" onSubmit={(e) => this.addToList(e.target.value)}>+</Button>
                        </form>
                    </Grid>
            </div>
        )
    }
}
